function setCurrentYear()
{
	var now = new Date();
	var pageElements = document.getElementsByClassName('currentYear');
	currYear = now.getFullYear();
	//debug: alert("Setting current year, # of elements = " + pageElements.length);

	/* loop through each element and set the current year */
	for(i=0; i < pageElements.length; i++)
	{
		pageElements[i].textContent = currYear;
	}
	
}

function initPerfMonPage()
{
	perfMonitorTypeChange();
	linkPerfTriggerActivate();
	pktTraceIPProtoChange();
	pktTraceSrcPortChange();
	pktTraceDstPortChange();
	
	// Update the time stamp fields with current time for Start time 
	var now = new Date();
	now.setHours(now.getHours()+2) // update for Eastern time
	var nowYear = now.getFullYear(); var nowMonth = now.getMonth() + 1; var nowDay = now.getDate();
	var nowHours = now.getHours(); var nowMinutes = now.getMinutes(); var nowSeconds = now.getSeconds();
	if(nowMonth < 10)
	{
		nowMonth = "0" + nowMonth;
	}
	if(nowDay < 10)
	{
		nowDay = "0" + nowDay;
	}
	if(nowHours < 10)
	{
		nowHours = "0" + nowHours;
	}
	if(nowMinutes < 10)
	{
		nowMinutes = "0" + nowMinutes;
	}
	if(nowSeconds < 10)
	{
		nowSeconds = "0" + nowSeconds;
	}
	var startTime = nowYear+"-"+nowMonth+"-"+nowDay+"-"+nowHours+"-"+nowMinutes+"-"+nowSeconds;
	//alert(startTime);
	// and 5 minutes later for Stop Time
	nowMinutes = now.getMinutes() + 5;
	if(nowMinutes >= 60)
    {
	    nowMinutes = nowMinutes - 60;
    }
	if(nowMinutes < 10)
	{
		nowMinutes = "0" + nowMinutes;
	}
	var stopTime = nowYear+"-"+nowMonth+"-"+nowDay+"-"+nowHours+"-"+nowMinutes+"-"+nowSeconds;
	//alert(stopTime);
	// Update the appropriate fields
	$('#pktValidationStart').val(startTime);
	$('#pktValidationStop').val(stopTime);
	$('#netFlowStart').val(startTime);
	$('#netFlowStop').val(stopTime);
	$('#pktTraceStart').val(startTime);
	$('#pktTraceStop').val(stopTime);
	$('#tcpFlowStart').val(startTime);
	$('#tcpFlowEnd').val(stopTime);
}

function getIPData()
{
	var ipDataURL = utepIPDataURL + $('#searchtermdot').val();
	$('#displayMsg').text('Please wait while executing the script: ' + ipDataURL + ' [it may take a while]');
	$('#resultContainer').html('');
	if(mymap != 0)
	{
		mymap.remove();		
	}
	// Send the task list command to UTEP server using a GET method via AJAX
	$.ajax(
	{
		type: "GET",
		url: ipDataURL,
		dataType: "json",
		success: getIPDataSuccess,
		error: getIPDataError
	}
	);	

}

function getIPDataSuccess(data,textStatus,jqXHR)
{
    
	if(data == null)
	{
		$('#displayMsg').text("The data from UTEP server was null, ["+textStatus+" "+jqXHR.status+"]");	
	}
	else
	{
		if(data.length != 0)
		{
			// Display the IP data query results
            var html = '';
            html += '<strong>Organization:</strong> ' + data.orgname + '<br/>';
            html += '<strong>AS number:</strong> ' + data.asnum + '<br/>';
            html += '<strong>City:</strong> ' + data.city + '<br/>';
            html += '<strong>Region:</strong> ' + data.region + '<br/>';
            html += '<strong>Country:</strong> ' + data.country + '<br/>';
            html += '<strong>Continent:</strong> ' + data.continent + '<br/>';
			$('#resultContainer').html(html);
			
        	/* leaflet geo visualization */
            var lat = Number(data.latitude);
            var long = Number(data.longitude);
			$('#displayMsg').text('Drawing map at ' + lat + ', ' + long);
			//if(mymap != 0)
			//{
			//	mymap.remove();			
			//}
        	mymap = L.map('mapContainer').setView([lat, long],13);
        	var osmUrl='http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png';
        	var osmAttrib='Map data Â© <a href="http://openstreetmap.org">OpenStreetMap</a> contributors';
        	var osm = new L.TileLayer(osmUrl, {attribution: osmAttrib});		
        	mymap.addLayer(osm);
            
        	L.marker([lat, long]).addTo(mymap)
            .bindPopup(data.orgname + " (AS #" + data.asnum + ")")
            .openPopup();
        	
        	mymap.setView(new L.LatLng(lat, long),15);

		}
		else
		{
			$('#displayMsg').text('Query error, check IP address is in dotted decimal notation:');
		}
	}

}

function getIPDataError(data)
{
	$('#displayMsg').text("Error retrieving task results, response from server: "+data.responseText);
}

