function getContinentData()
{
    // Obtain the continent geojson file from the data directory
    $.ajax(
    {
        type: "GET",
        url: "data/continents.json",
        dataType: "json",
        success: getContinentDataSuccess,
        error: getContinentDataError
    }
    );  

}

function getContinentDataSuccess(data,textStatus,jqXHR)
{ 
    if(data != null)
    {
        L.geoJson(data, {
            onEachFeature: function(feature, layer) {
                var label = L.marker(feature.properties.labelPoint, {
                  icon: L.divIcon({
                    className: 'label',
                    html: feature.properties.continentName,
                    iconSize: [100, 40]
                  })
                }).addTo(mymap);
                },
                color: 'orange'}).addTo(mymap);
        mymap.setView(continentCoord[0],2);
    }
    //
    // drop markers at geographic centers of the continents
    //
    // Africa
    L.marker(continentCoord[0]).addTo(mymap)
    .bindPopup("Africa");
    // Antarctica
    L.marker(continentCoord[1]).addTo(mymap)
    .bindPopup("Antarctica");
    // Asia
    L.marker(continentCoord[2]).addTo(mymap)
    .bindPopup("Asia");
    // Europe
    L.marker(continentCoord[3]).addTo(mymap)
    .bindPopup("Europe");
    // North America
    L.marker(continentCoord[4]).addTo(mymap)
    .bindPopup("North America");
    // Oceania
    L.marker(continentCoord[5]).addTo(mymap)
    .bindPopup("Oceania");
    // South America
    L.marker(continentCoord[6]).addTo(mymap)
    .bindPopup("South America");
    //
    // Render traffic matrix data on the map
    //
    for(var i = 0; i <= 6; i++)
    {
        for(var j = 0; j <= 6; j++)
        {
            if((vizData.continentMatrix[i][j] > 0) || (vizData.continentMatrix[j][i] > 0))
            {
                L.polyline([ continentCoord[i], continentCoord[j] ]).addTo(mymap).bindPopup(String(vizData.continentMatrix[i][j] + vizData.continentMatrix[j][i])+" bytes");        
            }
            
        }
    
    }
    mymap.setView(continentCoord[0],2);
    /* Trap map click events to call onMapClick() function above */
    //mymap.on('click', onMapClick);
}

