function submitPerfMonTask()
{
	// Determine which measurement task type is being submitted
	switch($('#perfMonitorType').val())
	{
	case 'pktValidation':
		submitPktValidationTask();
		break;
	case 'netFlow':
		submitNetFlowTask();
		break;
	case 'pktTrace':
		submitPktTraceTask();
		break;
	case 'trafficMatrix':
		alert("Submitting traffic matrix task");
		break;
	case 'linkGranularity':
		alert("Submitting link task");
		break;
	case 'flowGranularity':
		alert("Submitting flow task");
		break;
	case 'throughputTest':
		submitThroughputTestTask();
		break;
	case 'tcpFlow':
		submitTcpTestTask();
		break;
	}
}

function submitPktTraceTask()
{
	// Submit the packet trace task
	var taskMsg = "packet_trace "+$('#pktTraceStart').val()+" "+$('#pktTraceStop').val()+" "+$('#pktTraceSrcIP').val()+" "+$('#pktTraceDstIP').val()+" "
	+$('#pktTraceIPProto').val()+" "+$('#pktTraceSrcPort').val()+" "+$('#pktTraceDstPort').val();
	
	URL = (document.getElementById("ukyresultscheck").checked)? ukyTaskSubmissionURL : starlightTaskSubmissionURL;
	// Send the task string to UKY server using a GET method via AJAX
	$.ajax(
	{
		type: "GET",
		url: URL+taskMsg,
		dataType: "text",
		success: submitTaskSuccess,
		error: submitTaskError
	}
	);	
	//alert(taskMsg);
}

