function validateTaskDate(element)
{
	var fieldValue = element.value;
	
	// Validate the date time values
	var year = fieldValue.substring(0,4);
	var month = fieldValue.substring(5,7);
	var day = fieldValue.substring(8,10);
	var hour = fieldValue.substring(11,13);
	var minute = fieldValue.substring(14,16);
	var second = fieldValue.substring(17,19);
	if(Number(year) < Number(currYear))
	{
		alert("Year must be greater than or equal to "+currYear);
	}
	else if((Number(month) < 1) || (Number(month) > 12))
	{
		alert("Invalid month.");
	}
	else if((Number(day) < 1) || (Number(day) > 31))
	{
		alert("Invalid day.");
	}
	else if((Number(hour) < 0) || (Number(hour) > 23))
	{
		alert("Invalid hour.");
	}
	else if((Number(minute) < 0) || (Number(minute) > 59))
	{
		alert("Invalid minute.");
	}
	else if((Number(second) < 0) || (Number(second) > 59))
	{
		alert("Invalid second.");
	}
}

function validateIPAddress(element)
{
	var fieldValue = element.value;

	// Validate each byte of the IP address
	var byteVals = fieldValue.split('.');
	
	if(byteVals.length != 4)
	{
		alert("IP address does not contain four bytes.");
	}
	
	for(var i=0; i < 4; i++)
	{
		if(Number(byteVals[i]) > 255)
		{
			alert("IP address byte #"+(i+1)+" is invalid");
		}
	}
}

